                                                        aria-hidden="true"
                                                      >
                                                        <path
                                                          strokeLinecap="round"
                                                          strokeLinejoin="round"
                                                          d="M12 9v3.75m-9.303 3.376c-.866 1.5.217 3.374 1.948 3.374h14.71c1.73 0 2.813-1.874 1.948-3.374L13.949 3.378c-.866-1.5-3.032-1.5-3.898 0L2.697 16.126zM12 15.75h.007v.008H12v-.008z"
                                                        />
                                                      </svg>
                                                    </div>

                                                    <span className=" ml-2 mt-2 font-bold">
                                                      Only For QC
                                                    </span>
                                                  </div>
                                                  <form>
                                                    <div class="mb-4">
                                                      <label
                                                        for="Model"
                                                        class="block text-gray-700 bg text-sm font-bold mb-2"
                                                      >
                                                        Model:
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="Model"
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={
                                                          selectedItem.Model
                                                        }
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="part-number"
                                                        class="block text-gray-700 text-sm font-bold mb-2"
                                                      >
                                                        Part Number Customer :
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="part-number"
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={selectedItem.Pnc}
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="Week"
                                                        class="block text-gray-700  text-sm font-bold mb-2"
                                                      >
                                                        Week Target :
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="Week"
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={
                                                          selectedItem.Week
                                                        }
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="Stock"
                                                        class="block text-gray-700 text-sm font-bold mb-2"
                                                      >
                                                        Stock:
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="Stock"
                                                        readOnly
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={
                                                          Stock || initialStock
                                                        }
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="Wip"
                                                        class="block text-gray-700 text-sm font-bold mb-2"
                                                      >
                                                        Wip:
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="Wip"
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={
                                                          Wip || initialWip
                                                        }
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="SE"
                                                        class="block text-gray-700 text-sm font-bold mb-2"
                                                      >
                                                        Stock End:
                                                      </label>
                                                      <input
                                                        type="text"
                                                        id="SE"
                                                        class="border border-gray-400 bg-gray-200 rounded-md px-3 py-2 w-full appearance-none block"
                                                        value={
                                                          SE
                                                        }
                                                      />
                                                    </div>
                                                    <div class="mb-4">
                                                      <label
                                                        for="SE"
                                                        class="block text-gray-700 text-sm font-bold mb-2"
                                                      >
                                                        WIP:
                                                      </label>
                                                      <input
                                                        type="Number"
                                                        id="SE"
                                                        class="border border-gray-400 rounded-md px-3 py-2 w-full"
                                                        onChange={(e) => {
                                                          setQC(e.target.value);
                                                        }}
                                                      />
                                                    </div>
                                                  </form>
                                                </div>
                                                <div className="bg-gray-50 px-4 py-3 sm:flex sm:flex-row-reverse sm:px-6">
                                                  <button
                                                    onClick={UpdatePPIC}
                                                    type="button"
                                                    class="inline-flex w-full justify-center rounded-md bg-red-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-red-500 sm:ml-3 sm:w-auto"
                                                  >
                                                    Submit
                                                  </button>
                                                  <button
                                                    type="button"
                                                    onClick={() =>
                                                      setSelectedItem(false)
                                                    }
                                                    class="mt-3 inline-flex w-full justify-center rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 sm:mt-0 sm:w-auto"
                                                  >
                                                    Cancel
                                                  </button>
                                                </div>
                                              </div>
                                            </div>
                                          </div>
                                        </div>
                                      </>
                                    )}
                                  </td>
                                  {isDelet ? (
                                    <>
                                      <td class=" text-xs whitespace-nowrap border-t-0 font-medium ">
                                        <button
                                          onClick={() =>
                                            setSelectedItem(item.No)
                                          }
                                          className="trash-button"
                                        >
                                          <svg
                                            xmlns="http://www.w3.org/2000/svg"
                                            className="h-6 w-6"
                                            fill="none"
                                            viewBox="0 0 24 24"
                                            stroke="currentColor"
                                          >
                                            <path
                                              strokeLinecap="round"
                                              strokeLinejoin="round"
                                              strokeWidth={2}
                                              d="M6 18L18 6M6 6l12 12"
                                            />
                                          </svg>
                                        </button>

                                        {selectedItem && (
                                          <>
                                            <div
                                              class="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity"
                                              aria-labelledby="modal-title"
                                              role="dialog"
                                              aria-modal="true"
                                              style={{ zIndex: 50 }}
                                            >
                                              <div class="fixed inset-0 z-50 mt-32 overflow-y-auto">
                                                <div class="flex items-end justify-center text-center sm:items-center sm:p-0">
                                                  <div class="relative transform overflow-hidden rounded-lg bg-white text-left shadow-xl transition-all sm:my-8 sm:w-full sm:max-w-lg">
                                                    <div class="bg-white px-4 pb-4 pt-5 sm:p-6 sm:pb-4">
                                                      <div class="sm:flex sm:items-start">
                                                        <div class="mx-auto flex h-12 w-12 flex-shrink-0 items-center justify-center rounded-full bg-red-100 sm:mx-0 sm:h-10 sm:w-10">
                                                          <svg
                                                            class="h-6 w-6 text-red-600"
                                                            fill="none"
                                                            viewBox="0 0 24 24"
                                                            stroke-width="1.5"
                                                            stroke="currentColor"
                                                            aria-hidden="true"
                                                          >
                                                            <path
                                                              stroke-linecap="round"
                                                              stroke-linejoin="round"
                                                              d="M12 9v3.75m-9.303 3.376c-.866 1.5.217 3.374 1.948 3.374h14.71c1.73 0 2.813-1.874 1.948-3.374L13.949 3.378c-.866-1.5-3.032-1.5-3.898 0L2.697 16.126zM12 15.75h.007v.008H12v-.008z"
                                                            />
                                                          </svg>
                                                        </div>
                                                        <div class="mt-3 text-center sm:ml-4 sm:mt-0 sm:text-left">
                                                          <h3
                                                            class="text-base font-semibold leading-6 text-gray-900"
                                                            id="modal-title"
                                                          >
                                                            Delet Data
                                                          </h3>
                                                          <div class="mt-2">
                                                            <p class="text-sm text-gray-500">
                                                              Are you sure you
                                                              want to delet
                                                              data?
                                                            </p>
                                                          </div>
                                                        </div>
                                                      </div>
                                                    </div>
                                                    <div className="bg-gray-50 px-4 py-3 sm:flex sm:flex-row-reverse sm:px-6">
                                                      <button
                                                        onClick={handleDelete}
                                                        type="button"
                                                        class="inline-flex w-full justify-center rounded-md bg-red-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-red-500 sm:ml-3 sm:w-auto"
                                                      >
                                                        Submit
                                                      </button>
                                                      <button
                                                        onClick={() =>
                                                          setSelectedItem(false)
                                                        }
                                                        type="button"
                                                        // onClick={() =>
                                                        //   setSelectedItem(false)
                                                        // }
                                                        class="mt-3 inline-flex w-full justify-center rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 sm:mt-0 sm:w-auto"
                                                      >
                                                        Cancel
                                                      </button>
                                                    </div>
                                                  </div>
                                                </div>
                                              </div>
                                            </div>
                                          </>
                                        )}
                                      </td>
                                    </>
                                  ) : null}

                                  <td></td>
                                  {isWip ? (
                                    <>
                                      <td class=" text-xs whitespace-nowrap border-t-0 font-medium ">
                                        <button
                                          onClick={() =>
                                            setSelectedItemWip(item.No)
                                          }
                                          className="trash-button"
                                        >
                                          <svg
                                            xmlns="http://www.w3.org/2000/svg"
                                            className="h-6 w-6"
                                            fill="none"
                                            viewBox="0 0 24 24"
                                            stroke="currentColor"
                                          >
                                            <path
                                              d="M7 5C5.34315 5 4 6.34315 4 8V16C4 17.6569 5.34315 19 7 19H17C18.6569 19 20 17.6569 20 16V12.5C20 11.9477 20.4477 11.5 21 11.5C21.5523 11.5 22 11.9477 22 12.5V16C22 18.7614 19.7614 21 17 21H7C4.23858 21 2 18.7614 2 16V8C2 5.23858 4.23858 3 7 3H10.5C11.0523 3 11.5 3.44772 11.5 4C11.5 4.55228 11.0523 5 10.5 5H7Z"
                                              fill="#000000"
                                            />
                                            <path
                                              fill-rule="evenodd"
                                              clip-rule="evenodd"
                                              d="M18.8431 3.58579C18.0621 2.80474 16.7957 2.80474 16.0147 3.58579L11.6806 7.91992L11.0148 11.9455C10.8917 12.6897 11.537 13.3342 12.281 13.21L16.3011 12.5394L20.6347 8.20582C21.4158 7.42477 21.4158 6.15844 20.6347 5.37739L18.8431 3.58579ZM13.1933 11.0302L13.5489 8.87995L17.4289 5L19.2205 6.7916L15.34 10.6721L13.1933 11.0302Z"
                                              fill="#000000"
                                            />
                                          </svg>
                                        </button>

                                        {selectedItemWip && (
                                          <>
                                            <form
                                              class="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity"
                                              aria-labelledby="modal-title"
                                              role="dialog"
                                              aria-modal="true"
                                              style={{ zIndex: 50 }}
                                            >
                                              <div class="fixed inset-0 z-50 mt-32 overflow-y-auto">
                                                <div class="flex items-end justify-center text-center sm:items-center sm:p-0">
                                                  <div class="relative transform overflow-hidden rounded-lg bg-white text-left shadow-xl transition-all sm:my-8 sm:w-full sm:max-w-lg">
                                                    <div class="bg-white px-4 pb-4 pt-5 sm:p-6 sm:pb-4">
                                                      <div class="sm:flex sm:items-start">
                                                        <div class="mx-auto flex h-16 w-16 flex-shrink-0 items-center justify-center rounded-full bg-red-100 sm:mx-0 sm:h-10 sm:w-10"></div>
                                                        <div class="mt-3 text-center sm:ml-4 sm:mt-0 sm:text-left">
                                                          <h3
                                                            class="text-base font-semibold leading-6 text-gray-900"
                                                            id="modal-title"
                                                          >
                                                            Masukan WIP
                                                          </h3>
                                                          <div class="mb-4">
                                                            <label
                                                              for="Wip"
                                                              class="block text-gray-700 text-sm font-bold mb-2"
                                                            >
                                                              Wip:
                                                            </label>
                                                            <input
                                                              onChange={(e) => {
                                                                setWip(
                                                                  e.target.value
                                                                );
                                                              }}
                                                              type="number"
                                                              id="Wip"
                                                              class="border border-gray-400 rounded-md px-3 py-2 w-full"
                                                            />
                                                          </div>
                                                        </div>
                                                      </div>
                                                    </div>
                                                    <div className="bg-gray-50 px-4 py-3 sm:flex sm:flex-row-reverse sm:px-6">
                                                      <button
                                                        onClick={UpdatePPIC}
                                                        type="button"
                                                        class="inline-flex w-full justify-center rounded-md bg-red-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-red-500 sm:ml-3 sm:w-auto"
                                                      >
                                                        Submit
                                                      </button>
                                                      <button
                                                        onClick={() =>
                                                          setSelectedItemWip(
                                                            false
                                                          )
                                                        }
                                                        type="button"
                                                        // onClick={() =>
                                                        //   setSelectedItem(false)
                                                        // }
                                                        class="mt-3 inline-flex w-full justify-center rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 sm:mt-0 sm:w-auto"
                                                      >
                                                        Cancel
                                                      </button>
                                                    </div>
                                                  </div>
                                                </div>
                                              </div>
                                            </form>
                                          </>
                                        )}
                                      </td>
                                    </>
                                  ) : null}
                                </tr>
                              ))}
                            </tbody>
                          </table>
                        </div>
                      </div>
                    </div>
                    <footer class="relative  mt-16">
                      <div class="container mx-auto px-4">
                        <div class="flex flex-wrap items-center md:justify-between justify-center">
                          <div class="w-full md:w-6/12 px-4 mx-auto text-center"></div>
                        </div>
                      </div>
                    </footer>
                  </section>
                </div>
              </div>
            </div>
          </>
        ) : null}
      </main>
    </body>
  );
};

export default PPICProd;
